import React from 'react';
import { connect } from 'react-redux';

const PlayerDisplay = props => {
    const info = props.info

    if (info) {
        return (
            <div>
                <h1>{info.name}</h1>
            </div>
        )
    }
    else {
        return (
            <div>Loading</div>
        )
    }
};

export default PlayerDisplay;
